  constructor(props){
    super(props);

    this.state = dados;
  }



  render() {

    return (


      <div className="container">  
        <div className="row">
          <div className="col-md-7 mx-auto">
              <h1 className="text-center">MVC Todo</h1>


                      <Lista  itens={this.state.dados} />

          </div>

        </div>
      </div>

    )     
  }
}

export default App;
